import numpy as np

class Logistic_Regression():
  def __init__(self,learning_rate,noOfIteration):# constructor
      self.learning_rate=learning_rate
      self.noOfIteration=noOfIteration

  def fit(self,X,Y):
    X=np.array(X)
    Y=np.array(Y)
    self.m,self.n=X.shape
    self.w=np.zeros(self.n)
    self.b=0
    self.X=X
    self.Y=Y

    for i in range(self.noOfIteration):
      self.update_weights()


  def update_weights(self):
    Y_hat=1/(1+np.exp(-1*(self.X.dot(self.w) + self.b)))

    dw=(np.sum((Y_hat-self.Y).dot(self.X.T)))/self.m
    db=(np.sum(Y_hat-self.Y))/self.m

    self.w=self.w-self.learning_rate*dw
    self.b=self.b-self.learning_rate*db


  def predict(self):
    Y_pre=1/(1+np.exp(-1*(self.X.dot(self.w) + self.b)))
    Y_predict=np.where(Y_pre>0.5,1,0)
    return Y_predict

